import "../NavBar/navbar.css";
import { Nav,NavDropdown,Navbar,Container } from "react-bootstrap";

const NavBar = () => {
  
  return (
    <Container>
    <Navbar expand="lg" variant="light" bg="light">
      <Container>
        <Navbar.Brand href="#">Navbar</Navbar.Brand>
      </Container>
    </Navbar>
  </Container>
  );
};<Container>
  <Navbar expand="lg" variant="light" bg="light">
    <Container>
      <Navbar.Brand href="#">Navbar</Navbar.Brand>
    </Container>
  </Navbar>
</Container>

export default NavBar;
